*************************************************/\n#\n@regression\nFeature: Add to cart\n\n  As a customer of AskOmDch app,\n  I should be able to add product(s) to the cart,\n  So that I can purchase them\n\n  Rule: Add from Store\n\n    @smoke @demo\n    Scenario Outline: Add one quantity from Store\n      Given I'm on the Store Page\n      When I add a \"<product_name>\" to the cart\n      Then I should see 1 \"<product_name>\" in the cart\n      Examples:\n        | product_name    |\n        | Blue Shoes      |\n        | Anchor Bracelet |\n\n    Scenario: Add the product already in the cart\n      Given I'm on the Store Page\n      And I have 1 \"Blue Shoes\" in the cart\n      When I add it again\n      Then I should see 2 \"Blue Shoes\" in the cart\n\n  Rule: Add from Product page\n\n\t\t@bvt @sanity\n    Scenario Outline: Add the product to the cart\n      Given I'm browsing \"<product_name>\"\n      When I add <quantity> quantity to the cart\n      Then I should see <quantity> \"<product_name>\" in the cart\n      Examples:\n        | product_name    | quantity |\n        | Blue Shoes      | 1        |\n        | Anchor Bracelet | 2        |\n\n\t\t@bvt\n    Scenario: Add the product already in the cart\n      Given I'm browsing \"Blue Shoes\"\n      And I have 1 \"Blue Shoes\" in the cart\n      When I add 1 quantity to the cart\n      Then I should see 2 \"Blue Shoes\" in the cart\n\n\t\t@smoke\n    Scenario: Show an error when try to add zero quantity\n      Given I'm browsing \"Blue Shoes\"\n      When I add 0 quantity\n      Then I should see an error\n\n\t\t@sanity\n    Scenario Outline: Change the product quantity using arrows\n      Given I'm browsing \"Blue Shoes\"\n      And the selected quantity is <currentQuantity>\n      When I use <direction> arrow to change the quantity\n      Then the selected quantity changes to <newQuantity>\n      Examples:\n        | direction | currentQuantity | newQuantity |\n        | up        | 1               | 2           |\n        | down      | 2               | 1           |\n        | down      | 1               | 1           |\n\n\t\t@sanity\n    Scenario: Show a Banner when I add to cart\n      Given I'm browsing \"Blue Shoes\"\n      When I add 1 quantity\n      Then I should see the banner with text \"“Blue Shoes” has been added to your cart.\"\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/amisiralieva/Desktop/latest_bdd_april_24/test_automation_BDD_framework/src/test/resources/features/add_to_cart.feature","feature":{"location":{"line":10,"column":1},"tags":[{"location":{"line":9,"column":1},"name":"@regression","id":"a48472f8-1860-4d11-a114-faa1066de557"}],"language":"en","keyword":"Feature","name":"Add to cart","description":"  As a customer of AskOmDch app,\n  I should be able to add product(s) to the cart,\n  So that I can purchase them","children":[{"rule":{"location":{"line":16,"column":3},"tags":[],"keyword":"Rule","name":"Add from Store","description":"","children":[{"scenario":{"location":{"line":19,"column":5},"tags":[{"location":{"line":18,"column":5},"name":"@smoke","id":"03bc56de-9b22-47ce-ada5-5d91b4d4acdc"},{"location":{"line":18,"column":12},"name":"@demo","id":"51920bc1-80e7-4633-8e8f-88fb05fc0135"}],"keyword":"Scenario Outline","name":"Add one quantity from Store","description":"","steps":[{"location":{"line":20,"column":7},"keyword":"Given ","text":"I'm on the Store Page","id":"80265bc3-f0a4-475f-ae43-ae40decaac96"},{"location":{"line":21,"column":7},"keyword":"When ","text":"I add a \"<product_name>\" to the cart","id":"d7f9c2b5-2370-4b6a-9c34-c4a85e1ce6e3"},{"location":{"line":22,"column":7},"keyword":"Then ","text":"I should see 1 \"<product_name>\" in the cart","id":"13b1683e-d9d6-473a-996a-d76d938ef558"}],"examples":[{"location":{"line":23,"column":7},"tags":[],"keyword":"Examples","name":"","description":"","tableHeader":{"location":{"line":24,"column":9},"cells":[{"location":{"line":24,"column":
